import React from 'react';
import Pokemon from './pokemon';

const Home = () => {
    const [state, setState] = React.useState(false);
    const about = () => {
        `<p>This a pokedex app made on React JS</p>`
    }
    return(
        <div>
            <h2>Pokedex</h2>
            <nav>
                <ul>
                    <li><button onClick={() => setState(!state)}>Pokemon List</button></li>
                    <li>About</li>
                </ul>
            </nav>
            {state && <Pokemon />}
        </div>
    )
}

export default Home;
